    "2016-07-27T22:50:31.271461",nt"name": "study-plan-assessing-ecosystem-services-and-carbon-balance-in-support-of-land-management-a",nt"isopen":
    false,nt"url": null,nt"notes": "This study plan describes a collaborative
    research project to assess ecosystem services and estimate carbon balance in relation
    to water management and other restoration actions at the Great Dismal Swamp (GDS)
    National Wildlife Refuge (NWR). Research is also conducted at Pocosin Lakes (PL)
    and potentially the Alligator River (AR) NWR. Extensive ditch networks drain or
    otherwise affect the water regimes of the ecosystems at these refuges. Hydrologic
    manipulation to manage soil water percent saturation is an important method for
    restoration of the wetland ecosystems and may improve carbon sequestration and other
    ecosystem services.",nt"license_title": "License Not Specified",nt"extras":
